import React, { useState, useEffect } from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import Header from '../sharedpages/header';
import Navbar from '../sharedpages/navbar';
import Footer from '../sharedpages/footer';
import './ViewFeedback.css';

const ViewFeedback = () => {
  const [activeTab, setActiveTab] = useState('feedback');
  const [feedback, setFeedback] = useState(null);
  const location = useLocation();
  const navigate = useNavigate();

  // Mock feedback data - in real app this would come from the location state or API
  const mockFeedback = {
    id: 3,
    user: 'Noah Carter',
    date: '2024-01-15',
    subject: 'Listing Accuracy',
    message: 'The listing for the property at 123 Oak Street seems to have incorrect square footage. It\'s listed as 2000 sq ft, but it\'s actually closer to 1800 sq ft. Please update the listing to reflect the correct information.',
    rating: 3,
    status: 'Resolved',
    adminResponse: 'Thank you for the feedback. We will improve consistently.',
    responseDate: '2024-01-16'
  };

  useEffect(() => {
    // In a real app, you'd get feedback data from location state or fetch from API
    // For now, using mock data
    setFeedback(mockFeedback);
  }, []);

  const handleBackToFeedbackManagement = () => {
    navigate('/dashboard/feedback-management');
  };

  if (!feedback) {
    return (
      <div className="view-feedback-page">
        <Header />
        <div className="view-feedback-dashboard-container">
          <Navbar activeTab={activeTab} setActiveTab={setActiveTab} />
          <main className="view-feedback-main-content">
            <div className="view-feedback-content-header">
              <h1 className="view-feedback-main-title">Loading...</h1>
            </div>
          </main>
        </div>
        <Footer />
      </div>
    );
  }

  return (
    <div className="view-feedback-page">
      <Header />
      <div className="view-feedback-dashboard-container">
        <Navbar activeTab={activeTab} setActiveTab={setActiveTab} />
        <main className="view-feedback-main-content">
          <div className="view-feedback-content-header">
            <div className="view-feedback-breadcrumb">
              <span className="view-feedback-breadcrumb-item">Feedback Management</span>
              <span className="view-feedback-breadcrumb-separator">/</span>
              <span className="view-feedback-breadcrumb-item">View Feedback</span>
            </div>
            <h1 className="view-feedback-main-title">View Feedback</h1>
          </div>
          
          <div className="view-feedback-content">
            {/* Feedback Details Section */}
            <section className="view-feedback-feedback-details-section">
              <h2 className="view-feedback-section-title">Feedback Details</h2>
              <div className="view-feedback-feedback-info">
                <div className="view-feedback-feedback-item">
                  <label>Feedback from:</label>
                  <span>{feedback.user}</span>
                </div>
                <div className="view-feedback-feedback-item">
                  <label>Date:</label>
                  <span>{feedback.date}</span>
                </div>
                <div className="view-feedback-feedback-item">
                  <label>Subject:</label>
                  <span>{feedback.subject}</span>
                </div>
                <div className="view-feedback-feedback-item">
                  <label>Message:</label>
                  <div className="view-feedback-feedback-message">{feedback.message}</div>
                </div>
              </div>
            </section>

            {/* Admin Response Section */}
            <section className="view-feedback-admin-response-section">
              <h2 className="view-feedback-section-title">Admin Response</h2>
              <div className="view-feedback-response-info">
                <div className="view-feedback-response-item">
                  <label>Response Date:</label>
                  <span>{feedback.responseDate}</span>
                </div>
                <div className="view-feedback-response-item">
                  <label>Response:</label>
                  <div className="view-feedback-admin-response-message">{feedback.adminResponse}</div>
                </div>
              </div>
            </section>

            {/* Back Button */}
            <section className="view-feedback-back-button-section">
              <button 
                className="view-feedback-back-btn"
                onClick={handleBackToFeedbackManagement}
              >
                Back to Feedback Management
              </button>
            </section>
          </div>
        </main>
      </div>
      <Footer />
    </div>
  );
};

export default ViewFeedback;
